import Layout from '../components/Layout';
import Link from 'next/link';
import SingleProjectView from '../components/SingleProjectView'
import myImg from "static/game_of_life.png"
const arrayOfProjects = [
    {
        id: 1,
        project_github_link: 'red_project_one',
        title: "Game of Life",
        image: myImg,
        technologies: "JavaScript, HTML, CSS",

    },
    {
        id: 2,
        project_github_link: 'red_project_two',
        title: "Weather App React",
        image: myImg,
        technologies: "React, API",

    }
]
const Projects = () =>(

    <Layout>
        {console.log(<img src={myImg} />)}
        {console.log(<img src={myImg} />)}
        <div className='background_body'>
            <h4>Projects</h4>
            <div>
                {arrayOfProjects.map(project=>(
                <div key={project.id} className="box">
                    {console.log(<img src={require(project.image)} />)}
                    <SingleProjectView key={project.id} data={project}/>

                </div>
                ))}
            </div>


            <style jsx>
                {`@import url('https://fonts.googleapis.com/css?family=Lato');
            h4{
                text-transform: uppercase;
                letter-spacing: 2px;
                font-family: 'Lato', sans-serif;
                color:#424242;
                text-align: center;
                margin-bottom:5%;
                align-text:center;
                padding: 5%;
            }
            .box{
                position: relative;
                margin-left: auto;
                margin-right: auto;
                margin-top:50px;
                margin-bottom:50px;
                border-radius:4px;
                width:50%;
                height:auto;
                background-color:#efeeee;
                box-shadow: 6px 6px 16px rgb(209,205,199,0.5), -6px -6px 16px  rgba(255,255,255, 0.5);
            }
            .background_body{
                background-color:#efeeee;
                background-size: 100px 100px;
                background-position: 0 0, 50px 50px;
                height: 1000px;
            }

            `}
            </style>
        </div>
    </Layout>
)
export default Projects
